import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Navigation from './components/Navigation';
import Footer from './components/Footer';
import Services from './pages/Services';
import Projects from './pages/Projects';
import BDS from './pages/BDS';
import Research from './pages/Research';
import Training from './pages/Training';


// Placeholder components for other pages to be created
const LiyuMikleta = () => <div className="min-h-screen flex flex-col"><h1 className="text-4xl m-8">Liyu Mikleta Page</h1></div>;

function App() {
  return (
    <>
      <Navigation />
      <main className="flex-grow">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/services" element={<Services />} />
          <Route path="/projects" element={<Projects />} />
          <Route path="/bds" element={<BDS />} />
          <Route path="/research" element={<Research />} />
          <Route path="/training" element={<Training />} />
          <Route path="/liyumilketa" element={<LiyuMikleta />} />
          {/* Add more routes as pages are created */}
        </Routes>
      </main>
      <Footer />
    </>
  );
}

export default App;
